import React from "react";

function Experience() {
  return (
    <section>
      <h2>İş Deneyimi</h2>
      <p>Şirket Adı: NONA DONDURMA</p>
      <p>Pozisyon: Satış Danışmanlığı</p>
      <p>Çalışma Süresi: 2018 - 2023</p>
      <p>Açıklama: Dondurma ustasıyım uzun süre dondurmacılık yaptım.</p>
    </section>
    
  );
}

export default Experience;
